import React from "react";
import { Link, Route, Switch } from "react-router-dom";

const CharacterCard = (props) => {
  return (
    <>
      <Link to={`/character-detail/${props.id}`}>Home</Link>
      <article>
        <img
          src={props.image}
          title={props.name}
          alt={`Este personaje es : ${props.name} `}
        />
        <h3>{props.name}</h3>
        <p>{props.species}</p>
      </article>
    </>
  );
};

export default CharacterCard;
